#include <bits/stdc++.h>using namespace std;typedef long long ll;int main(){    int t;    cin >> t;    while(t--){        ll n,k;        cin>>n>>k;        set<ll> st;        map<ll,bool> vis;        for(int i=0;i<n;i++){            ll x;            cin>>x;            st.insert(x);            vis[x]=false;        }        vector<ll> ans;        bool y=true;        for(auto it=st.begin();it!=st.end();it++){            ll num=*it;            if(vis[num])continue;            vis[num]=true;            for(ll j=2*num;j<=k;j+=num){                if(st.find(j)==st.end()){                    y=false;                    break;                }                else{                    vis[j]=true;                }            }            if(y){                ans.push_back(num);            }            else{                break;            }        }        if(!y)cout<<-1<<endl;        else{            cout<<ans.size()<<endl;            for(ll x:ans)cout<<x<<" ";            cout<<endl;        }    }}